#!/usr/bin/env python3

import base64
import bz2
import pickle
import sys

raw_answers = b''

# Decode the answers
answers_dict = pickle.loads(bz2.decompress(base64.b64decode(raw_answers)))

# Read lines from stdin
lines = [line.strip() for line in sys.stdin.readlines()]

# Parse input
queries = [[int(i) for i in line.split()] for line in lines[1:]]

# Answer all queries
for query in queries:
    a, m = query

    # The contraints on 'a' and 'm' are that they are always positive,
    # but apparently they can be zero in the test cases (yay)
    if not a:
        print(1)
    elif not m:
        print(0)
    else:
        print(answers_dict[(a, m)])
